import React from "react";
import { PRODUCTS } from "../../asset/products";
import { Product } from "./product";

export const Shop = () => {
  return (
    <div className="shop">
      <div className="shopTitle">
        <h1>Stevens Shop</h1>
      </div>
      <div className="products">
        {PRODUCTS.map((product) => (
          <Product data={product} />
        ))}
      </div>
    </div>
  );
};
